import { Component } from 'react';
import SignIn from './SignIn';
import '../styles/App.css';
import Dashboard from './Dashboard';

class App extends Component{

  constructor() {
    super()

    this.state = {
      isloggedIn: false
    }
  }

  rendringPage(){

    if(this.state.isloggedIn){
      return <Dashboard />
    } else{
      return <SignIn />
    }

  }

  render() {
    return (
      <div>
        {this.rendringPage()}
      </div>
    )
  }
}

export default App
